import React from 'react';

export default function PolicyCompare({ data }) {
  if (!data.length) return <div className="empty-state">비교할 정책을 선택해주세요</div>;

  const attributes = Object.keys(data[0]).filter(key => key !== 'district');

  return (
    <div className="policy-compare-table">
      <table>
        <thead>
          <tr>
            <th>항목</th>
            {data.map(policy => (
              <th key={policy.district}>{policy.district}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {attributes.map(attr => (
            <tr key={attr}>
              <td>{attr}</td>
              {data.map(policy => (
                <td key={`${policy.district}-${attr}`}>
                  {policy[attr]}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
